window.bookSummaryJSON = "<p><b>Sometimes the only way out is to fall further inâ€¦</b></p> <p>As Earth's leaders gather to usher in a new era of interplanetary cooperation, a remarkable discovery in the skies above New Kerguelen threatens to destroy the peace on both worlds.</p> <p>The consequences are so immediate and the potential ramifications so colossal, thoughts of a new era quickly fall by the wayside.</p> <p>And when all that counts is surviving the tumultuous present, responsibility might fall again on Dan McCarthy -- humanity's once unwilling conduit between worlds -- to bravely take a leap like no other...</p>"; 
